import Item from './item';
import Category from './category';

class ItemTicket extends Item {
  amount: number;
  
  constructor(id: number, title: string, price: number, pictureUrl: string, category: Category, amount: number) {
    super(id, title, price, pictureUrl, category);
    this.amount = amount;
  }

  equals(it: ItemTicket): boolean {
    return it.id === this.id && it.productDetail.equals(this.productDetail);
  }

  getTicketTitle(): string {
    return this.productDetail.getTicketTitle(this.title);
  }
}

export default ItemTicket;
